import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { IconDefinitions, twitterIconDefinition } from "./NavbarData";
import "./Navbar.css"
import ProfileCard from "../../ProfileCard/ProfileCard";
import {
    IconLookup,
    IconDefinition,
    findIconDefinition
  } from '@fortawesome/fontawesome-svg-core'

import {faTwitter} from '@fortawesome/free-brands-svg-icons';

type ElementData = {
    icon: IconDefinition,
    label: string
}

const Navbar = (): React.ReactElement => {
    return (
        <div className="navbar">
            <ul>
            <li className="navbar-element"><a href=""><NavbarHeader /></a></li>
            {IconDefinitions.map(iconDefinition => (
                <NavbarElement icon={iconDefinition.icon} label={iconDefinition.label} />
            ))
            }
            <li className="navbar-element"><TweetButton /></li>
            <li className="navbar-element">
            <ProfileCard displayPic="https://images.unsplash.com/flagged/photo-1570612861542-284f4c12e75f?w=600&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8M3x8cGVyc29ufGVufDB8fDB8fHww" 
      name='Kartikay Sapra' userName='kyzan' />
            </li>
            </ul>
        </div>
    )
};

const NavbarHeader = () => {
    return (
        <div className="navbar-header twitter-logo">
            <FontAwesomeIcon icon={faTwitter} />
        </div>
    )
}

const NavbarElement = ({icon, label}: ElementData): React.ReactElement => {
    return (
        <li className="navbar-element">
            <p><a href="/"><span className="icon"><FontAwesomeIcon icon={icon} /></span> &nbsp;{label}</a></p>
        </li>
    )
}

const TweetButton = () => {
    return (
        <button>
            Tweet
        </button>
    )
}

export default Navbar;
